import React, { useEffect, useState } from "react";
import axios from "axios";
import * as XLSX from "xlsx";
import "../css/AdminDAshboard.css"; // Your custom styles

const AdminDashboard = () => {
  const [activePage, setActivePage] = useState("pending");
  const [bookings, setBookings] = useState([]);
  const [search, setSearch] = useState("");

  const fetchData = async () => {
    try {
      const routeMap = {
        pending: "/api/admin/pending-bookings",
        approved: "/api/admin/approved-bookings",
        rejected: "/api/admin/rejected-bookings",
      };
      const res = await axios.get(routeMap[activePage]);
      setBookings(res.data);
    } catch (error) {
      console.error("Error fetching bookings:", error);
    }
  };

  useEffect(() => {
    if (activePage !== "update") fetchData();
  }, [activePage]);

  const handleExport = () => {
    const ws = XLSX.utils.json_to_sheet(bookings);
    const wb = XLSX.utils.book_new();
    XLSX.utils.book_append_sheet(wb, ws, "Bookings");
    XLSX.writeFile(wb, `${activePage}_bookings.xlsx`);
  };

  const handleAction = async (action, id) => {
    try {
      const url = `/api/admin/${action}-booking/${id}`;
      await axios.post(url);
      fetchData();
    } catch (error) {
      console.error(`Error during ${action}:`, error);
    }
  };

  const filteredBookings = bookings.filter((booking) =>
    booking.classroomNumber.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div className="dashboard">
      <aside className="sidebar">
        <h2>Admin Panel</h2>
        <button onClick={() => setActivePage("pending")}>Pending</button>
        <button onClick={() => setActivePage("approved")}>Approved</button>
        <button onClick={() => setActivePage("rejected")}>Rejected</button>
        <button onClick={() => setActivePage("update")}>Update DB</button>
      </aside>

      <main className="main-content">
        {activePage === "update" ? (
          <h1>Update Database Page</h1>
        ) : (
          <>
            <h2>
              {activePage.charAt(0).toUpperCase() + activePage.slice(1)} Requests
            </h2>
            <div className="controls">
              <input
                type="text"
                placeholder="Search by classroom..."
                value={search}
                onChange={(e) => setSearch(e.target.value)}
              />
              <button onClick={handleExport}>Export to Excel</button>
            </div>

            <div className="booking-list">
              {filteredBookings.length === 0 ? (
                <p>No bookings found.</p>
              ) : (
                filteredBookings.map((booking) => (
                  <div className="booking-card" key={booking._id}>
                    <div>
                      <strong>Classroom:</strong> {booking.classroomNumber}
                    </div>
                    <div>
                      <strong>Teacher ID:</strong> {booking.teacherId}
                    </div>
                    <div>
                      <strong>Day:</strong> {booking.day}
                    </div>
                    <div>
                      <strong>Time Slot:</strong> {booking.timeSlot}
                    </div>
                    <div>
                      <strong>From:</strong>{" "}
                      {new Date(booking.fromDate).toDateString()}
                    </div>
                    <div>
                      <strong>To:</strong>{" "}
                      {new Date(booking.toDate).toDateString()}
                    </div>
                    <div className={`status ${booking.status}`}>
                      {booking.status}
                    </div>

                    {activePage === "pending" && (
                      <div className="actions">
                        <button onClick={() => handleAction("approve", booking._id)}>
                          Approve
                        </button>
                        <button onClick={() => handleAction("reject", booking._id)}>
                          Reject
                        </button>
                      </div>
                    )}
                  </div>
                ))
              )}
            </div>
          </>
        )}
      </main>
    </div>
  );
};

export default AdminDashboard;
